export default class APIService {

  static SubmitEmail(email) {
    return fetch(`http://127.0.0.1:5000/`, {
      'method':'POST',
      headers: {
	'Content-Type':'application/json'
      },
      email: JSON.stringify(email)
    })
    .then(resp => resp.json())
  }
}
